import React from 'react';
import { Container,BookingDetail, BookingPackage } from './styles';
import { Button } from '@material-ui/core';

const Search = () => {
return (
	<Container>
		<BookingPackage>
			<div>Booking details</div>
			<div>
				<div>
					Depart Date
					<Button variant="contained" >Modify</Button>
				</div>
			</div>
		</BookingPackage><br /><br />
		<BookingDetail>
			<div className="img">
				<img src="/search_page_car_img.png" width="40px" height="40px"/>
			</div>
		</BookingDetail>
	</Container>
  )
}
export default Search ;
